import React, { useState } from 'react';
import { Row, Col, Card, Form, Button, Container } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { login } from '../redux/actions/userActions';
import Message from '../components/Message';
import Loader from '../components/Loader';

const HomeScreen = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const dispatch = useDispatch();
  const navigate = useNavigate();

  const userLogin = useSelector((state) => state.userLogin);
  const { loading, error, userInfo } = userLogin;

  const submitHandler = (e) => {
    e.preventDefault();
    dispatch(login(email, password));
  };

  // If user is already logged in, redirect to dashboard
  if (userInfo) {
    navigate('/view-profile');
    return null;
  }

  return (
    <Container className="py-5">
      <Row className="justify-content-center">
        <Col md={6} className="text-center mb-5">
          <h1 className="display-4 fw-bold" style={{ color: 'var(--primary-color)' }}>
            <i className="fas fa-graduation-cap me-3"></i>
            Trainee Management System
          </h1>
          <p className="lead">
          </p>
        </Col>
      </Row>
      <Row className="justify-content-center">
        <Col md={6} lg={5}>
          <Card className="shadow border-0 rounded-lg overflow-hidden">
            <Card.Header className="bg-primary text-white text-center py-4">
              <h3 className="mb-0">Login</h3>
            </Card.Header>
            <Card.Body className="p-4">
              {error && <Message variant="danger">{error}</Message>}
              {loading && <Loader />}
              <Form onSubmit={submitHandler}>
                <Form.Group controlId="email" className="mb-3">
                  <Form.Label>Email Address</Form.Label>
                  <Form.Control
                    type="email"
                    placeholder="Enter email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                  />
                </Form.Group>

                <Form.Group controlId="password" className="mb-4">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Enter password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                  />
                </Form.Group>

                <div className="d-grid">
                  <Button
                    type="submit"
                    size="lg"
                    className="btn-login"
                    style={{
                      backgroundColor: '#ef7c8e',
                      borderColor: '#e05c70',
                      color: 'white',
                      borderRadius: '25px',
                      padding: '12px 20px',
                      fontWeight: '600',
                      boxShadow: '0 4px 6px rgba(239, 124, 142, 0.2)',
                      transition: 'all 0.3s ease'
                    }}
                  >
                    <i className="fas fa-sign-in-alt me-2"></i>Sign In
                  </Button>
                </div>
              </Form>
            </Card.Body>
            <Card.Footer className="py-3 text-center bg-light">
              <p className="mb-0">
                Don't have an account?{' '}
                <Link to="/register" className="text-primary fw-bold">
                  Register here
                </Link>
              </p>
            </Card.Footer>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default HomeScreen;
